import React from 'react';
import './Facing.css';

const Facing = (props) => {
console.log(props)
const facing = props.facing 
try {
  return (

    <li className="facing-info">
    <h2 className="facing-info__shelf">
      {'sID:'+ facing.shelfID}
    </h2>

     <img  
         className="facing-info__upc" 
         src={require('../imgs/'+ facing.productUPC+'.png')} 
         alt = 'ProductImg'
     />

    <p  className="facing-info__gondola">
      {"Gond:"+ facing.displayfixtureID}
    </p>
    </li>
  );
}
catch(err) {
  console.error("Error retrieving png for ",facing.productUPC)
}


};
export default Facing;
